Accounts_CustomFields_Description:
Skal være et gyldigt JSON, hvor nøgler er feltnavne, der indeholder en ordbog med feltindstillinger. Eksempel:<br/><code>{
"rolle": {
"type": "vælg",
"defaultValue": "student",
"muligheder": ["lærer", "studerende"],
"kræves": sandt,
"modifyRecordField": {
"array": sandt,
"felt": "roller"
}
},
"twitter": {
"type": "tekst",
"kræves": sandt,
"minLength": 2,
"maxlængde": 10
}
}</code>

Custom_Translations_Description:
Skal være et gyldigt JSON, hvor nøgler er sprog, der indeholder en ordbog med nøgle og oversættelser. Eksempel: <br/><code>{
"en": {
"Kanaler": "Værelser"
},
"pt": {
"Kanaler": "Salas"
}
}</code>
